import AuthService from "../services/auth.service";

import "../module/figure.module.css"

type Props = {};

type State = {
    redirect: string | null,
    loading: boolean,
    message: string
};

export default class Figure extends Component<Props, State> {
    constructor(props: Props) {
        super(props);
        this.state = {
            redirect: null,
            loading: false,
            message: ""
